import Header from "../components/Header";

const Login = () => {
    return (
        <div>
            <Header title={`login page`}/>
            <div><textarea placeholder="아이디" /></div> 
            <div><textarea placeholder="비밀번호" /></div>
        </div>
    );
}

export default Login;
